import React from 'react'
import Navbar from './Navbar';
import Topbar from './Topbar';
import '../style/home.scss'


const Home = () => {
  return (
    <div className='home'>
        <Navbar />
        <div className='homeContainer'>
            <Topbar />
        </div>
    </div>
  )
}

export default Home;
